    ZoneInput = '';

    LDesInput = '';
    DictBName = {};
    Build = [];
    DictBId = {};

    DictLvName = {};
    DictLvId ={};
    Level =[];

    

    constructor(props){
        super(props);
        this.state={
            BIdSelected: 0,
        }
    }

    componentDidMount(){
